import React from 'react';
import {CollapsibleItem} from 'react-materialize'

const Snippet = ({snippet}) => (
  <CollapsibleItem>
    <div>User: {snippet.user}</div>
    <div>HTML: {snippet.html}</div>
  </CollapsibleItem>
);

export default Snippet;
